import React, { useState, useEffect } from 'react';
import { Play, Pause, Square, X } from 'lucide-react';
import { useApp } from '../contexts/AppContext';

export const PomodoroTimer: React.FC = () => {
  const { addXP, missions } = useApp();
  const [showTimer, setShowTimer] = useState(false);
  const [duration, setDuration] = useState(25);
  const [timeLeft, setTimeLeft] = useState(0);
  const [isRunning, setIsRunning] = useState(false);
  const [selectedTask, setSelectedTask] = useState<string>('');

  useEffect(() => {
    let interval: NodeJS.Timeout;
    
    if (isRunning && timeLeft > 0) {
      interval = setInterval(() => {
        setTimeLeft(prev => prev - 1);
      }, 1000);
    } else if (timeLeft === 0 && isRunning) {
      setIsRunning(false);
      addXP(30);
      // Show completion notification
      const audio = new Audio('data:audio/wav;base64,'); audio.play().catch(() => {});
      // Show completion notification
      setTimeout(() => {
        alert('Sesja Pomodoro zakoczona! Czas na przerw.');
      }, 100);
    }

    return () => clearInterval(interval);
  }, [isRunning, timeLeft, addXP]);

  const formatTime = (seconds: number) => {
    const mins = Math.floor(seconds / 60);
    const secs = seconds % 60;
    return `${mins.toString().padStart(2, '0')}:${secs.toString().padStart(2, '0')}`;
  };

  const startTimer = () => {
    setTimeLeft(duration * 60);
    setIsRunning(true);
  };

  const pauseTimer = () => {
    setIsRunning(false);
  };

  const stopTimer = () => {
    setIsRunning(false);
    setTimeLeft(0);
  };

  const activeMissions = missions.filter(m => m.isActive && !m.completed);

  if (isRunning && timeLeft > 0) {
    return (
      <div className="fixed inset-0 bg-black bg-opacity-90 flex items-center justify-center z-50">
        <div className="text-center">
          <div className="text-6xl font-mono text-white mb-8 animate-pulse">
            {formatTime(timeLeft)}
          </div>
          
          <div className="flex space-x-4 justify-center">
            <button
              onClick={pauseTimer}
              className="bg-orange-600 hover:bg-orange-700 text-white p-3 rounded-lg transition-colors"
            >
              <Pause className="w-6 h-6" />
            </button>
            <button
              onClick={stopTimer}
              className="bg-red-600 hover:bg-red-700 text-white p-3 rounded-lg transition-colors"
            >
              <Square className="w-6 h-6" />
            </button>
          </div>

          {selectedTask && (
            <div className="mt-6 text-gray-300">
              <p className="text-sm">Pracujesz nad:</p>
              <p className="text-lg font-medium">{missions.find(m => m.id === selectedTask)?.title}</p>
            </div>
          )}
        </div>
      </div>
    );
  }

  return (
    <>
      {/* Floating Button */}
      <button
        onClick={() => setShowTimer(true)}
        className="fixed bottom-6 right-6 bg-red-500 hover:bg-red-600 text-white p-4 rounded-full shadow-lg transition-all duration-200 hover:scale-110 z-40"
      >
        <span className="text-2xl"></span>
      </button>

      {/* Timer Modal */}
      {showTimer && (
        <div className="fixed inset-0 bg-black bg-opacity-50 flex items-center justify-center z-50">
          <div className="bg-gray-800 p-8 rounded-lg max-w-md w-full mx-4 animate-fade-in">
            <div className="flex items-center justify-between mb-6">
              <h3 className="text-white font-bold text-xl flex items-center space-x-2">
                <span></span>
                <span>Timer Pomodoro</span>
              </h3>
              <button
                onClick={() => setShowTimer(false)}
                className="text-gray-400 hover:text-white transition-colors"
              >
                <X className="w-6 h-6" />
              </button>
            </div>

            <div className="space-y-6">
              <div>
                <label className="block text-sm font-medium text-gray-300 mb-3">
                  Dugo sesji: {duration} minut
                </label>
                <input
                  type="range"
                  min="5"
                  max="60"
                  value={duration}
                  onChange={(e) => setDuration(parseInt(e.target.value))}
                  className="w-full h-2 bg-gray-600 rounded-lg appearance-none cursor-pointer"
                />
                <div className="flex justify-between text-xs text-gray-400 mt-1">
                  <span>5 min</span>
                  <span>60 min</span>
                </div>
              </div>

              {activeMissions.length > 0 && (
                <div>
                  <label className="block text-sm font-medium text-gray-300 mb-2">
                    Wybierz zadanie (opcjonalnie)
                  </label>
                  <select
                    value={selectedTask}
                    onChange={(e) => setSelectedTask(e.target.value)}
                    className="w-full p-3 bg-gray-700 text-white rounded-lg border border-gray-600 focus:border-cyan-500 focus:outline-none"
                  >
                    <option value="">Brak konkretnego zadania</option>
                    {activeMissions.map((mission) => (
                      <option key={mission.id} value={mission.id}>
                        {mission.title}
                      </option>
                    ))}
                  </select>
                </div>
              )}

              <div className="flex space-x-3">
                <button
                  onClick={startTimer}
                  className="flex-1 bg-green-600 hover:bg-green-700 text-white px-6 py-3 rounded-lg flex items-center justify-center space-x-2 transition-colors"
                >
                  <Play className="w-5 h-5" />
                  <span>Start</span>
                </button>
                <button
                  onClick={() => setShowTimer(false)}
                  className="flex-1 bg-gray-600 hover:bg-gray-700 text-white px-6 py-3 rounded-lg transition-colors"
                >
                  Anuluj
                </button>
              </div>
            </div>
          </div>
        </div>
      )}
    </>
  );
};